import React from 'react'
import BasicSelect from './BasicSelect'
import { Box } from '@mui/material';
import BasicDatePicker from './BasicDatePicker';
import Button from '@mui/material/Button';


const SearchBar = () => {
  return (
    <div>
      <Box sx={{ display: 'flex', alignItems: 'stretch', bgcolor: 'white', p: 1.5 }}>
        <BasicSelect text='to suburb' />
        <BasicSelect text='from suburb' />
        <BasicDatePicker />
        <Button variant="contained" sx={{ padding: 2 }}>GiddyUP!</Button>
      </Box>
    </div>
  )
}

export default SearchBar;
